__NUXT_JSONP__("/drugs/Baltaleucel-T", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:b,chebiId:b,chemicalFormula:b,definition:"A preparation of autologous Epstein-Barr virus (EBV)-specific cytotoxic T-lymphocytes (CTLs), which have specific reactivity to the EBV antigens, latent membrane proteins (LMP) 1 (LMP1) and 2 (LMP2), EBV nuclear antigen (EBNA) and BamHI-A rightward frame-1 (BARF1), with potential immunomodulating and antineoplastic activities. Upon administration, baltaleucel-T targets and binds to EBV-expressing cancer cells specifically expressing the targeted antigens. This may kill LMP1\u002FLMP2\u002FEBNA\u002FBARF1-expressing EBV-associated cancer cells. LMP1, LMP2, EBNA and BARF1 are tumor-associated antigens (TAAs) that are specifically associated with EBV infection, and play key roles in the proliferation of a variety of tumors.",fdaUniiCode:"F9670LP52I",identifier:"C129374",preferredName:a,semanticType:"Cell",subclassOf:["C28681"],synonyms:["BALTALEUCEL-T","Baltaleucel T",a,"CMD-003","Epstein Barr Virus-specific LMP1\u002FLMP2\u002FEBNABARF1-targeting Autologous Cytotoxic T-lymphocytes"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FBaltaleucel-T",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Baltaleucel-T","","2021-10-30T13:31:08.963Z")));